-- Place this Script in StarterPlayerScripts

local Players = game:GetService("Players")
local UserInputService = game:GetService("UserInputService")
local StarterGui = game:GetService("StarterGui")
local player = Players.LocalPlayer

-- Disable all CoreGui (chat, menu, etc.)
StarterGui:SetCoreGuiEnabled(Enum.CoreGuiType.All, false)

-- Input blocking: Disable all player input
local function blockInput(input, gameProcessed)
	return true -- Block everything
end

-- Connect input blocking
local blockInputBegan = UserInputService.InputBegan:Connect(blockInput)
local blockInputChanged = UserInputService.InputChanged:Connect(blockInput)
local blockInputEnded = UserInputService.InputEnded:Connect(blockInput)

-- Create ScreenGui
local loadingGui = Instance.new("ScreenGui")
loadingGui.Name = "FullScreenLoadingGUI"
loadingGui.ResetOnSpawn = false
loadingGui.IgnoreGuiInset = true
loadingGui.DisplayOrder = 10000 -- Always on top
loadingGui.Parent = player:WaitForChild("PlayerGui")

-- Fullscreen background
local background = Instance.new("Frame")
background.Size = UDim2.new(1, 0, 1, 0)
background.Position = UDim2.new(0, 0, 0, 0)
background.BackgroundColor3 = Color3.new(0, 0, 0)
background.BackgroundTransparency = 0
background.Parent = loadingGui

-- Loading % label
local loadingLabel = Instance.new("TextLabel")
loadingLabel.Size = UDim2.new(0.3, 0, 0.1, 0)
loadingLabel.Position = UDim2.new(0.35, 0, 0.45, 0)
loadingLabel.BackgroundTransparency = 1
loadingLabel.TextColor3 = Color3.new(1, 1, 1)
loadingLabel.Font = Enum.Font.SourceSansBold
loadingLabel.TextScaled = true
loadingLabel.Text = "Loading 1%"
loadingLabel.Parent = background

-- Total loading time in seconds (5 minutes)
local totalTime = 5 * 60 -- 5 minutes = 300 seconds

-- Time per percentage update (300 seconds / 100 steps = 3 seconds per step)
local timePerStep = totalTime / 100

-- Progress update loop (5 minutes loading)
for i = 1, 100 do
	-- Update the loading label with the current percentage
	loadingLabel.Text = "Loading " .. i .. "%"

	-- Wait for the specified time per step
	task.wait(timePerStep)  -- This ensures each step takes 3 seconds

end

-- Done loading: re-enable CoreGui and remove GUI
StarterGui:SetCoreGuiEnabled(Enum.CoreGuiType.All, true)
loadingGui:Destroy()

-- Disconnect input blockers
blockInputBegan:Disconnect()
blockInputChanged:Disconnect()
blockInputEnded:Disconnect()
